/**
 * @param {number} x
 * @param {number} y
 * @return {number}
 */
var minimumOperationsToMakeEqual = function(x, y) {
    const queue = [[x, 0]];
    const visited = new Set([x]);

    while (queue.length) {
        const [current, ops] = queue.shift();
        if (current === y) return ops;

        // Possible next steps
        const possibilities = [
            current - 1,
            current + 1,
            ...(current % 5 === 0 ? [current / 5] : []),
            ...(current % 11 === 0 ? [current / 11] : [])
        ];

        for (let next of possibilities) {
            if (!visited.has(next) && next >= 0) {
                visited.add(next);
                queue.push([next, ops + 1]);
            }
        }
    }
};
